            .collection("jjalbang-url")
            .where("selectedStorage", "==", storageIndex)
            .get();
          //console.log("selectedStorage", selectedStorage);
          // const urlsData = urlsSnapshot.docs.map((doc) => {
          //   //doc.data().url;
          //   console.log("doc.data()" , doc.data());
          // });
          const urlsData = urlsSnapshot.docs.map((doc) => doc.data().url);
          setFile(urlsData);
        } else {
          console.log("Storage not found");
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [storageName]);

